import React,{useEffect,useState} from 'react'
import {loadeditFleets} from "../fleethelp/fleetapi"

export default function EditFleetsData({match}) {

    const [code, setcode] = useState("")
    const [name, setname] = useState("")
    const [phone, setphone] = useState("")
    useEffect(() => {
        onLoad(match.params.fleetId);
      }, []);
      const onLoad = (fleetId) =>{
        loadeditFleets(fleetId).then(res => {
            console.log(res);
            setcode(res.fid)
            setname(res.name)
            setphone(res.phone)
        })
        .catch(err => {
            console.log(err)
        })
      }
    return (
        <div>
            <div className="text-center">
                <h3 className="mt-5">
                    Fleets Edit 
                </h3>
                <div className="mt-4">
                <form className="container text-left">
  <div className="form-group">
    <label for="exampleInputEmail1">Delivery Boy name</label>
    <input type="text" className="form-control" />
  </div>
  <div className="form-group">
    <label for="exampleInputPassword1">Code</label>
    <input type="text" className="form-control"/>
  </div>
  
  <button type="submit" className="btn btn-primary">Submit</button>
</form>
                </div>
            </div>
        </div>
    )
}
